import React from 'react'

const Apt = (props) => {
  return (
    <>
        {JSON.parse(props.data).map((item,index) => (
            <CTableRow key={index}>
                <CTableDataCell>{item.Apt_No}</CTableDataCell>
                <CTableDataCell className="text-center">{item.Block_No}</CTableDataCell>
                <CTableDataCell>{item.Furniture_Status}</CTableDataCell>
                <CTableDataCell className="text-center">{item.Occupancy}</CTableDataCell>
                <CTableDataCell>{item.Room_Count}</CTableDataCell>
            </CTableRow>

        ))}
    </>

  )
}

export default Apt
